import './header.scss';

function Header() {
  const menuItems = [
    { name: 'Home', link: 'www.google.com' },
    { name: 'About me', link: 'www.google.com' },
    { name: 'Gallery', link: 'www.google.com' },
    { name: 'Contact', link: 'www.google.com' }
  ];

  const mappedItems = menuItems.map((item) => <li>{item.name}</li>);

  return <ul className="menu">{mappedItems}</ul>;
}

export default Header;
